import { GET_TASK, ADD_TASK, DELETE_TASK } from '../actions/types'

const initialState = {
    tasks: []
}

export default function(state = initialState, action) {
    switch(action.type) {
        case GET_TASK:
            return {
                ...state
            }
        case ADD_TASK:
            return {
                ...state
            }
        case DELETE_TASK:
            return {
                ...state
            }
        default:
            return {
                ...state
            }
    }
}
